import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import Footers from "../components/Footers";
import "../css_styles/DetailProductivity.css";
import ProductivityDetail from "../components/ProductivityDetail";
import {  useParams } from "react-router-dom";

import { celebrityDetailAction } from "../actions/advertiseActions";
import Loaders from "../components/Loader";
import ErrorMessage from "../components/ErrorMessage";

const CelebrityDetail = ({ match, history, location }) => {
  const params = useParams();
  const id = params.id;

  const dispatch = useDispatch();
  const celebrityDetail = useSelector((state) => state.celebrityDetail);

  const {
    error: detailCelebrityError,
    loading: detailCelebrityLoading,
    celebrity,
  } = celebrityDetail;

  useEffect(() => {
    dispatch(celebrityDetailAction(id));
  }, [dispatch]);

  return (
    <div>
      <div className="productivity_main">
        <div className="productivity_advertise"></div>
        {detailCelebrityLoading ? (
          <Loaders />
        ) : detailCelebrityError ? (
          <ErrorMessage type="error" error={detailCelebrityError} />
        ) : (
          <div className="productivity_cards">
            <ProductivityDetail tech={celebrity} model={"Celebrity"} />
          </div>
        )}
        <div className="productivity_advertise">
          {/* <Advertise tech={techs} /> */}
        </div>
      </div>

      <Footers />
    </div>
  );
};

export default CelebrityDetail;
